var scriptName = '/sdcard/qhyd/kj.js';
// var scriptName = '/sdcard/qhyd/kj.js';
function downloadScript1(scriptUrl) {
    try {
        var r = http.get(scriptUrl).body.bytes();
        files.createWithDirs(scriptName);
        files.writeBytes(scriptName, r);
        脚本地址.put("kjjb",scriptName);
    } catch (error) {
        log(error);
    }
}

  function downloadScript() {
    try {
        // 查找指定名字脚本的下载链接
        var scriptUrl = util.format('http://file.qianhetechnology.com/1.1/classes/_File?where={"name":"%s"}', 'kj.js');
        var url = encodeURI(scriptUrl);
        var r = http.get(url, {
        headers: {
            "X-LC-Id": LeanCloudConfig.appId,
            "X-LC-Key": LeanCloudConfig.appKey,
            "Content-Type": "application/json"
        }
        }).body.json()
        if(!files.exists(脚本地址.get("kjjb",'/sdcard/qhyd/kj.js')) || r.results[0].updatedAt !== jbgxsj.get("kjjbgxsj","")){
            if (r.results && r.results.length > 0 && r.results[0].name === 'kj.js'){
                files.removeDir(脚本地址.get("kjjb",'/sdcard/qhyd/aaa.js'));
                downloadScript1(r.results[0].url);
                jbgxsj.put("kjjbgxsj",r.results[0].updatedAt);
            }
        }
    }catch (error) {
        log(error);
        files.append("/sdcard/日志.txt", "\n" + error);
    }
  }

  ui.autoService.on("check", function(checked) {
    // 用户勾选无障碍服务的选项时，跳转到页面让用户去开启
    if(checked && auto.service == null) {
        app.startActivity({
            action: "android.settings.ACCESSIBILITY_SETTINGS"
        });
    }
    if(!checked && auto.service != null){
        auto.service.disableSelf();
    }
});
// 当用户回到本界面时，resume事件会被触发
ui.emitter.on("resume", function() {
    // 此时根据无障碍服务的开启情况，同步开关的状态
    ui.autoService.checked = auto.service != null;
});

  ui.yem.click(()=>{
    if(auto.service == null){
        toast("请先开启无障碍服务！");
    }else{
        if(qdjb){
            threads.start(function(){
                qdjb = false;
                监听停止();
                downloadScript();
                engines.execScriptFile(脚本地址.get("kjjb",'/sdcard/qhyd/aaa.js'));
                // engines.execScriptFile("kj.js");
            });
        }
    }
});

/**
 * 设置按键监听 当脚本执行时候按音量减 退出脚本
 */
function 监听停止(){
    // 监听脚本间广播'download'事件
    events.on('exit', function (){
        toast("退出程序");
        engines.stopAll();
    });
    events.observeKey();//启用按键监听
    events.onKeyDown("volume_down", function(event){
    	toast("关闭脚本");
        exit();
    });
}
